(1, '世界你好', 'first', '<p>你好，世界。</p><p><br /></p><p>by Xy Blog。</p><p>2013年5月16日 20:11:55</p><p>localhost<br /></p>', '小雨,blog,你好，世界。', '', '', 1368628954, 1368879136, 0, '', 0, 1, 1),
(2, '更新日志', 'change log', '<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	2013年5月15日 &nbsp;\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		完成项目目录，配置TP框架\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	2013年5月16日 &nbsp;\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		移植后台模版，设计博客数据库\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	2013年5月17日 &nbsp;\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		设计博客浏览页，移植TP官网模版\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	2013年5月18日 &nbsp;\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		上传云空间（SAE,BAE）,进行第一次修改，完善数据库link表，修复html的HEAD描述和关键词\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	2013年5月19日\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		0:14:34 &nbsp; &nbsp;前台留言初步完成。\r\n	</p>\r\n	<p>\r\n		13:03:51 &nbsp; &nbsp;后台留言管理初步完成\r\n	</p>\r\n	<p>\r\n		17:24:27 &nbsp; &nbsp;增加反馈管理\r\n	</p>\r\n	<p>\r\n		17:24:34 &nbsp; &nbsp;日志，留言，反馈 删除修复\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	2013年5月20日\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		修复SAE云平台部署\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	2013-05-21\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		13:10:55 &nbsp; &nbsp;完成留言列表，留言审核\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	2013-05-22\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		0:14:06 &nbsp; &nbsp;完成后台留言管理，完成评论以及评论管理\r\n	</p>\r\n	<p>\r\n		20:22:36 &nbsp; 完成Home分组下的二维码生成，增加测试账户\r\n	</p>\r\n	<p>\r\n		23:37:33 &nbsp; 开放后台测试\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	2013-05-24\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		完成二级评论的实现，已在博客页和留言页实现\r\n	</p>\r\n	<p>\r\n		优化后台显示\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	2013-05-25\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		13:39:44 &nbsp; &nbsp;完成留言邮箱提醒，二级评论邮箱提醒，修复id错误时提醒\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	2013-05-26\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		0:33:51 &nbsp; &nbsp;完成数据库配置部分，及其生效部分，现已实现：博客开关，回复审核，邮箱通知开关\r\n	</p>\r\n	<p>\r\n		0:52:49 &nbsp; &nbsp;修复博客评论邮件通知内容里的链接地址，留言部分新增主页项\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	2013-06-15\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		15:23:10 &nbsp; &nbsp;完成博客初级配置部分，邮件配置部分\r\n	</p>\r\n	<p>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;完成rss生成，完成百度和谷歌的ping服务\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	2013-06-2-\r\n</p>\r\n<blockquote>\r\n	<p>\r\n		22:00:00&nbsp;&nbsp;&nbsp; 更新在线编辑器（换为：<a href="http://www.kindsoft.net/" target="_blank">kindsoft.net</a>）\r\n	</p>\r\n	<p>\r\n		&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 完成Home分组的投稿\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	小雨\r\n</p>', '日志,小雨,blog,xyblog', '', '', 1368628954, 1371787019, 1, NULL, 0, 1, 1),
(9, '开源地址', '', '<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	GIThub地址：<a target="_blank" href="https://github.com/dingdayu/xyblog">https://github.com/dingdayu/xyblog</a>\r\n</p>\r\n<p>\r\n	CSDN code：<a target="_blank" href="https://code.csdn.net/dingdayu/xyblog">https://code.csdn.net/dingdayu/xyblog</a>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	测试链接：<a target="_blank" href="http://xyblog.sinaapp.com/">http://xyblog.sinaapp.com/</a>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '', '', '171.11.106.58', 1371787748, NULL, 1, NULL, 0, 1, 1),
(3, '求暑假工机会', '', '<p>本人资料在首页上略有介绍，今年高三，高考的话题不太愿意提起，成绩太差。</p><p>而在高考结束，就会有三个月的暑假，考虑到其他原因，也有两个月的时间，不太想在家待着。</p><p>说到这里，就要再对自己进行进一步介绍了。</p><p>本人，来自农村，至此尚未走出，曾趁暑假随外出打工的父母去过广东两次，随对大城市有这些许向往。</p><p>虽来自农村，但却也较早的接触到计算机（相比于同伴，无法与大城市相比），在对计算机接触的六年里，前三年懵懵懂懂，在虚拟世界里游荡，曾参与过现在很多游戏的内测，曾沉迷过网络文学（网络小说），也曾作为白痴般的小白混迹于曾经的黑客论坛。</p><p>在进入高中后，意识到，那些都是虚幻，自学计算机知识。</p><p>在这里不得不说自己对于计算机的自学能力，在无人帮助，没有门路的情况下，学习至此，很是辛苦。当初的条件，不可谓不辛苦。</p><p>在初一一年里学习计算机基础知识，恶补很多理论知识，编程的一些理论和网站建设的一些理论。写到这里，又想起当初接触到这些的时候域名还是廉价品，几元一个；空间还可以申请免费的，而且免备案，只可惜恰巧错过。</p><p><br /></p><p>好像前面说到的都是无用的，下面说下我能做些什么吧。</p><p><br /></p><p>如同这个博客，在所懂的‘编程’里，较擅长的就是这个PHP动态网页编程了。</p><p>其次，对于C#,也有所基础，不得不说的是接触才不过两个月，但是已有一个插件作品。</p><p>其实，对于计算机的维护和一般问题的维修及组装，也懂些许，（当然一般主板芯片什么的无能为力）。</p><p>在高中三年里，高二的时候班级里配置了多媒体，在参与多媒体维护的时间里，学习到不少东西，也对系统有了不少的认识。</p><p>另外Java的编程也能看懂一些，但独立编程尚不能完成。</p><p><br /></p><p>其实这些都是次要，我最想表达的是我的学习能力，而且是计算机方面的学习能力。</p><p>上面这些都是在学校学习的同时完成的，而上面的学习都是通过当初诺基亚6700s的智能机，学习的理论知识，不要不相信，都是通过uc上网查资料学习理论，很少有实践的机会。</p><p><br /></p><p>如果你那里有工作的机会，还请考虑我一下，但是很抱歉的是我只能作为暑假工参与，因为我暂时还不能放弃学业，纵使高考最后只是大专。</p><p><br /></p><p>联系方式:</p><p>QQ:614422099</p><p>邮箱：614422099@qq.com</p><p><br /></p><p>工作地点不限，暑假打算自己外出闯荡一番。</p>', '', '', '', 1369114395, 1369114657, 0, NULL, 0, 1, 1),
(4, '开放后台测试', 'test', '<p>现已开放后台测试登陆。</p><blockquote><p>用户名：<strong>test</strong></p><p>密码：<strong>123456</strong></p></blockquote><p>已封闭测试用户的密码修改和资料修改。</p><p>开放各模块的浏览权限，但未开放编辑和增加权限。</p><p><br /></p><p>其实，后台只有基本功能，设置模块和附件管理模块还在本地测试中。</p><p>所以只有，博客管理，评价管理，和留言管理。<br /></p>', '', '', '', 1369233741, 1369237906, 1, NULL, 0, 1, 1),
(5, '已实现离线二维码功能', 'qrcode', '<p>今天下午已完成二维码的生成功能。</p><p><br /></p><p>前台已部署上。</p><p>后续会支持二维码登陆功能。</p><p><br /></p><p>二维码在每个页面的右侧上方悬浮。</p><p><br /></p><p>可以使用你的手机进行扫描了，测试看看哦！<br /></p>', '', '', '', 1369237829, NULL, 0, NULL, 0, 1, 1),
(6, '笔记本键盘坏了，而且又快高考，停两天', '', '<p>笔记本从昨天键盘就出问题了，大概是上档键短路了，电脑开机后一直警报，正在想办法换个键盘。<br />而且马上又要高考，所以这个博客的编写要等两天了，放心，时间不会很长，还有一个周就快考试了。最多15天，就会回来的。<br /></p>', '', '', '', 1369707474, NULL, 0, NULL, 0, 1, 0),
(7, '还真有人刷评论', '', '<p>没想到还没完成的博客也有人刷评论广告，没办法，先开启审核。<br /></p>', '', '', '', 1371282084, NULL, 0, NULL, 0, 1, 1),
(8, '什么是RSS？', '', '<p><strong>RSS的定义</strong></p><p><br /> &nbsp; &nbsp;RSS(Really Simple Syndication)是一种描述和同步网站内容的格式，是目前使用最广泛的XML应用。<br />RSS是一种起源于网景的推技术，将订户订阅的内容传送给他们的通讯协同格式(Protocol)。RSS可以是以下三个解释的其中一个： <br /> &nbsp; Really Simple Syndication <br /> &nbsp; RDF (Resource Description Framework) Site Summary <br /> &nbsp; Rich Site Summary <br /> &nbsp; 其实这三个解释都是指同一种Syndication的技术。 RSS目前广泛用于网上新闻频道，blog和wiki，主要的版本有0.91, 1.0, 2.0。<br /><br /><strong>本站的RSS地址</strong></p><p><br /> &nbsp; &nbsp;<a href="http://dingxiaoyu.com/Rss">http://dingxiaoyu.com/Rss</a><br /></p><p><br /></p><p> <strong>RSS会帮您更好的节省时间</strong></p><p><br /> &nbsp; &nbsp;如果您每天都上网看咨询/技术/朋友的BLOG，那么您如果每个网站/BLOG都去翻一遍的话，那么会使您那宝贵的时间更加的“宝贵”！所以如果 您使用一个RSS阅读器（Google Reader、抓虾都是不错的RSS阅读器）的话，会节省大量的时间.</p>', '', '', '', 1371285801, NULL, 0, NULL, 0, 1, 1),
(10, 'Android用Service在后台定时更新widget', '', '在开发Android的widget时，第一个需要解决的问题就是怎么实现让widget定时更新，在查阅比较多的资料后，一般情况用Service在后台更新，废话不多说，贴代码如下：&nbsp;\r\n<p>\r\n	Widget:&nbsp;\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<pre>public class NewsWidgetProvider extends AppWidgetProvider {\r\n\r\n	@Override\r\n	public void onDeleted(Context context, int[] appWidgetIds) {\r\n	}\r\n\r\n	@Override\r\n	public void onDisabled(Context context) {\r\n		// TODO Auto-generated method stub\r\n		super.onDisabled(context);\r\n	}\r\n\r\n	@Override\r\n	public void onEnabled(Context context) {\r\n		// TODO Auto-generated method stub\r\n		super.onEnabled(context);\r\n	}\r\n\r\n	@Override\r\n	public void onUpdate(Context context, AppWidgetManager appWidgetManager,int[] appWidgetIds) {\r\n\r\n		NewsService.updateAppWidgetIds(appWidgetIds);\r\n		context.startService(new Intent(context,NewsService.class));\r\n	}\r\n	\r\n	public static RemoteViews updateAppWidget(Context context,List&lt;RssNews&gt; list) {\r\n		RemoteViews views = new RemoteViews(context.getPackageName(),R.layout.appwidget_layout);\r\n		if (list.size() &gt; 3) {\r\n			views.setTextViewText(R.id.textView01, list.get(0).title);\r\n			views.setTextViewText(R.id.textView02, list.get(1).title);\r\n			views.setTextViewText(R.id.textView03, list.get(2).title);\r\n		}\r\n\r\n		Intent detailIntent=new Intent(context,NewsSiteList.class);\r\n		\r\n		PendingIntent pending=PendingIntent.getActivity(context, 0, detailIntent, 0);\r\n		views.setOnClickPendingIntent(R.id.textView01, pending);\r\n		views.setOnClickPendingIntent(R.id.textView02, pending);\r\n		views.setOnClickPendingIntent(R.id.textView03, pending);\r\n		return views;\r\n	}\r\n	\r\n	@Override\r\n	public void onReceive(Context context, Intent intent) {\r\n		super.onReceive(context, intent);\r\n	}\r\n\r\n}</pre>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	Service:\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<pre>public class NewsService extends Service implements Runnable {\r\n	\r\n	private static final String TAG="NewsService"; \r\n	private static Queue&lt;Integer&gt; sAppWidgetIds=new LinkedList&lt;Integer&gt;();\r\n	public static final String ACTION_UPDATE_ALL = "com.xxxx.news.UPDATE_ALL";\r\n	private static boolean sThreadRunning = false;\r\n	private static Object sLock = new Object();\r\n	\r\n	@Override\r\n	public IBinder onBind(Intent intent) {\r\n		return null;\r\n	}\r\n	\r\n	public static void updateAppWidgetIds(int[] appWidgetIds){\r\n		synchronized (sLock) {\r\n			for (int appWidgetId : appWidgetIds) {\r\n				sAppWidgetIds.add(appWidgetId);\r\n			}\r\n		}\r\n	}\r\n	\r\n	public static int getNextWidgetId(){\r\n		synchronized (sLock) {\r\n			if (sAppWidgetIds.peek() == null) {\r\n				return AppWidgetManager.INVALID_APPWIDGET_ID;\r\n			} else {\r\n				return sAppWidgetIds.poll();\r\n				\r\n			}\r\n		}\r\n	}\r\n	\r\n	private static boolean hasMoreUpdates() {\r\n		synchronized (sLock) {\r\n			boolean hasMore = !sAppWidgetIds.isEmpty();\r\n			if (!hasMore) {\r\n				sThreadRunning = false;\r\n			}\r\n			return hasMore;\r\n		}\r\n	}\r\n\r\n	@Override\r\n	public void onCreate() {\r\n		super.onCreate();\r\n	}\r\n\r\n	@Override\r\n	public void onStart(Intent intent, int startId) {\r\n		super.onStart(intent, startId);\r\n		if (null != intent) {\r\n			if (ACTION_UPDATE_ALL.equals(intent.getAction())) {\r\n				AppWidgetManager widget = AppWidgetManager.getInstance(this);\r\n				updateAppWidgetIds(widget.getAppWidgetIds(new ComponentName(this, NewsWidgetProvider.class)));\r\n			}\r\n		}\r\n		synchronized (sLock) {\r\n			if (!sThreadRunning) {\r\n				sThreadRunning=true;\r\n				new Thread(this).start();\r\n			}\r\n		}\r\n	}\r\n\r\n	@Override\r\n	public void run() {\r\n		SharedPreferences setting=getSharedPreferences("com.xxxx.news_preferences", 0);\r\n		String updateTime=setting.getString("list_time", "1800000");\r\n		String updateUrl=setting.getString("list_site", "xxxxxxxxx");\r\n		\r\n		\r\n		AppWidgetManager appWidgetManager=AppWidgetManager.getInstance(this);\r\n		RemoteViews updateViews=null;\r\n		\r\n		while (hasMoreUpdates()) {\r\n			int appWidgetId=getNextWidgetId();\r\n			List&lt;RssNews&gt; listNews = NewsContenttList.getNewsList(updateUrl);\r\n			if (listNews != null) {\r\n				updateViews = NewsWidgetProvider.updateAppWidget(this, listNews);\r\n			}\r\n			if (updateViews != null) {\r\n				appWi', '', '', '1.192.235.231', 1419162678, 1419162762, 0, NULL, 0, 1, 1);
